import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Main from './components/Main';
import Sidebar from './components/Sidebar';
import Login from './components/Login';
import Signup from './components/Signup';
import Notifications from './components/Notifications'; // 알림 페이지 컴포넌트 추가
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Sidebar />
        <div className="content">
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/schedule" element={<div>일정 페이지</div>} />
            <Route path="/notifications" element={<div>알림 페이지</div>} />
            <Route path="/resume" element={<div>자기소개서 페이지</div>} />
            <Route path="/education" element={<div>학력 / 경력 페이지</div>} />
            <Route path="/portfolio" element={<div>포트폴리오 페이지</div>} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
